// import axios from 'axios';

export const addBill = function() {
  return fetch('http://localhost:3001/posts').then(resp => {
    if (resp.status === 200) {
      let a = resp.json();
      console.log(a);
      return a;
    } else {
      console.error('error');
    }
  });
};
